function calculateAspectRatioFit(t,i,h,e){var a=Math.min(h/t,e/i);return{width:t*a,height:i*a}}function findImageResize(t){var i=t.width;$(t.target_id).each(function(){if("100%"==i)$(this).css("width","100%"),$(this).css("height","auto");else{var h=t.height,e=$(this).width(),a=$(this).height(),s=calculateAspectRatioFit(e,a,i,h);$(this).css("width",s.width+"px"),$(this).css("height",s.height+"px")}})}function findRemoveImage(t,i){$(t).each(function(){var t=$(this).data("filename");i==t&&$(this).remove()})}